// Import the necessary components and styles
import React from 'react';
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import { Link } from 'react-router-dom';
import './navbar.css';

// Define the NavbarComponent
function NavbarComponent() {
  return (
    <Navbar bg="dark" expand="lg" className="mb-3">
      <Container fluid>
        <Navbar.Brand as={Link} to="/">INFOLIBRA</Navbar.Brand>
        <Navbar.Toggle aria-controls="navbar-nav" />
        <Navbar.Collapse id="navbar-nav">
          <Nav className="me-auto">
            <Nav.Link as={Link} to="/">Home</Nav.Link>
            <NavDropdown title="Dropdown" id="navbar-dropdown">
              <NavDropdown.Item href="#action3">By Author</NavDropdown.Item>
              <NavDropdown.Item href="#action4">By Book</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action5">By Category</NavDropdown.Item>
            </NavDropdown>
          </Nav>
          <Form className="d-flex">
            <Form.Control
              type="search"
              placeholder="Search"
              className="me-2"
              aria-label="Search"
            />
            <Button variant="outline-success">Search</Button> &nbsp;&nbsp;
            &nbsp; &nbsp;         
            </Form>
          <Button as={Link} to="/auth/login" variant="primary" className="thick-color">
            Login
          </Button>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

// Export the NavbarComponent
export default NavbarComponent;
